def reverse_complement(dna:str)->str:   
    base_pairing = {"A":"T", "T": "A", "C": "G", "G": "C"}

    comp_rev_dna = []
    for nucleotide in dna[::-1]:
        comp_rev_dna.append(base_pairing[nucleotide])
    
    return("".join(comp_rev_dna))

